class ClothesDB {
  static final ClothesDB _clothesDatabase = new ClothesDB._internal();

  final String tableName = "clothes";

  static String path;
  Database db;

  bool didInit = false;

  static ClothesDB get() {
    return _clothesDatabase;
  }

  ClothesDB._internal();

  /// Use this method to access the database, because initialization of the database (it has to go through the method channel)
  Future<Database> _getDb() async {
    if (!didInit) await _init();
    return db;
  }

  Future init() async {
    return await _init();
  }

  Future _init() async {
    // Get a location using path_provider
    Directory documentsDirectory = await getApplicationDocumentsDirectory();

    String path = join(documentsDirectory.path, "wardrobe_1.1.db");
    ClothesDB.path = path;
    db = await openDatabase(path, version: 1,
        onCreate: (Database db, int version) async {
      // When creating the db, create the table
      await db.execute("CREATE TABLE CATEGORIES ("
          "ID INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL,"
          "NAME TEXT UNIQUE"
          ")");
      for (var categoryName in garmentCategories) {
        await db
            .execute("INSERT INTO CATEGORIES(NAME) VALUES(?)", [categoryName]);
      }
      await db.execute("CREATE TABLE $tableName ("
          "ID INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL,"
          "CATEGORY_ID INTEGER,"
          "SEX TEXT,"
          "SIZE TEXT,"
          "QUANTITY INT"
          ")");
      await db.execute("CREATE TABLE AUDIT_LOGS ("
          "ID INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL,"
          "OPERATION TEXT NOT NULL,"
          "TABLE_NAME TEXT NOT NULL,"
          "TIMESTAMP DATETIME DEFAULT CURRENT_TIMESTAMP NOT NULL,"
          "EXTERNAL_ID INTEGER,"
          "DATA TEXT"
          ")");
    });
    didInit = true;
  }

