  Future<void> insertAuditEntry(AuditEntry auditEntry) async {
    var db = await _getDb();
    db.execute('INSERT INTO AUDIT_LOGS (OPERATION, TABLE_NAME, EXTERNAL_ID, DATA) VALUES (?, ?, ?, ?)',
        [auditEntry.operation, auditEntry.table, auditEntry.external_id, auditEntry.values]);
  }

  Future<List<AuditEntry>> getAuditEntries() async {
    var db = await _getDb();
    var result = await db.rawQuery(
        'SELECT * FROM AUDIT_LOGS ORDER BY TIMESTAMP DESC LIMIT 100 ',
        []);
    if (result.length == 0) return [];
    List<AuditEntry> auditLogs = [];
    for (Map<String, dynamic> map in result) {
      var al =new AuditEntry(
          map["OPERATION"],
          map["TABLE_NAME"],
          timestamp: map["TIMESTAMP"],
          id: map["ID"],
          values: map["DATA"],
          external_id: map["EXTERNAL_ID"]);
      auditLogs.add(al);

    }
    return auditLogs;
  }

  Future<int> getCategoryIdFor(String category) async {
    var db = await _getDb();
    var result = await db
        .rawQuery('SELECT ID FROM CATEGORIES WHERE NAME= ? ', [category]);
    return result[0]["ID"];
  }

  Future<bool> doesCategoryExist(String category) async {
    var db = await _getDb();
    var result = await db
        .rawQuery('SELECT ID FROM CATEGORIES WHERE NAME= ? ', [category]);
    return result.length > 0;
  }

  Future<void> insertGarment(GarmentSQL garment) async {
    var db = await _getDb();
    Future<int> categoryId = getCategoryIdFor(garment.category);
    categoryId.then((value) => {
          db.execute(
              'INSERT INTO $tableName(CATEGORY_ID, SEX, SIZE, QUANTITY) VALUES (?, ?, ?, ?)',
              [value, garment.sex, garment.size, garment.quantity])
        });

    // await db.insert('category_cardigan', garment.toMap());
  }

  Future<void> insertCategory(String categoryName) async {
    var db = await _getDb();
    db.execute('INSERT INTO CATEGORIES (NAME) VALUES (?)', [categoryName]);
  }

  Future<List<GarmentSQL>> getClothesByCategory(String category) async {
    var db = await _getDb();
    var result = await db.rawQuery(
        'SELECT CLOTHES.ID, CLOTHES.QUANTITY, CLOTHES.SEX, CLOTHES.SIZE, CATEGORIES.NAME FROM CLOTHES, CATEGORIES WHERE CLOTHES.CATEGORY_ID = CATEGORIES.ID AND CATEGORIES.NAME = ? ORDER BY SIZE, SEX',
        [category]);
    if (result.length == 0) return [];
    List<GarmentSQL> garments = [];
    for (Map<String, dynamic> map in result) {
      print(map);
      garments.add(new GarmentSQL(
          id: map["ID"],
          category: map["NAME"],
          quantity: map["QUANTITY"],
          sex: map["SEX"],
          size: map["SIZE"]));
    }
    return garments;
  }

  Future<List<GarmentSQL>> getClothesByCategoryAndSex(String category, String sex) async {
    var db = await _getDb();
    var result = await db.rawQuery(
        'SELECT CLOTHES.ID, CLOTHES.QUANTITY, CLOTHES.SEX, CLOTHES.SIZE, CATEGORIES.NAME FROM CLOTHES, CATEGORIES WHERE CLOTHES.CATEGORY_ID = CATEGORIES.ID AND CATEGORIES.NAME = ? AND SEX=? ORDER BY SIZE',
        [category, sex]);
    if (result.length == 0) return [];
    List<GarmentSQL> garments = [];
    for (Map<String, dynamic> map in result) {
      garments.add(new GarmentSQL(
          id: map["ID"],
          category: map["NAME"],
          quantity: map["QUANTITY"],
          sex: map["SEX"],
          size: map["SIZE"]));
    }
    return garments;
  }


  Future<List<GarmentSQL>> getClothesBySize(String size) async {
    var db = await _getDb();
    var result = await db.rawQuery(
        'SELECT CLOTHES.ID, CLOTHES.QUANTITY, CLOTHES.SEX, CLOTHES.SIZE, CATEGORIES.NAME FROM CLOTHES, CATEGORIES WHERE CLOTHES.SIZE = ? AND CLOTHES.CATEGORY_ID = CATEGORIES.ID ORDER BY CLOTHES.SEX, CATEGORIES.NAME',
        [size]);
    if (result.length == 0) return [];
    List<GarmentSQL> garments = [];
    for (Map<String, dynamic> map in result) {

      garments.add(new GarmentSQL(
          id: map["ID"],
          category: map["NAME"],
          quantity: map["QUANTITY"],
          sex: map["SEX"],
          size: map["SIZE"]));
    }
    return garments;
  }

  Future<List<String>> getSizes() async {
    var db = await _getDb();
    var result = await db
        .rawQuery('SELECT DISTINCT(SIZE) FROM $tableName ORDER BY SIZE');
    List<String> sizes = [];
    for (Map<String, dynamic> map in result) {
      sizes.add(map['SIZE']);
    }
    return sizes;
  }

  Future<List<Category>> getCategories() async {
    var db = await _getDb();
    var result =
        await db.rawQuery('SELECT ID, NAME FROM CATEGORIES ORDER BY NAME');
    List<Category> categories = [];
    for (Map<String, dynamic> map in result) {
      categories.add(new Category(id: map['ID'], name: map['NAME']));
    }
    return categories;
  }

  Future<int> getQuantityForCategoryAndSex(String category, String sex, String size) async {
    var db = await _getDb();
    var result =
        await db.rawQuery('SELECT QUANTITY FROM CLOTHES,  CATEGORIES WHERE CLOTHES.CATEGORY_ID = CATEGORIES.ID AND CATEGORIES.NAME = ? AND CLOTHES.SIZE = ? AND CLOTHES.SEX = ?',
            [category, size, sex]);
    if (result.isEmpty) {
      return 0;
    }
    return result[0]["QUANTITY"];
  }


  Future<List<Category>> getCategoriesWithClothes() async {
    var db = await _getDb();
    var result =
    await db.rawQuery('SELECT DISTINCT NAME FROM CLOTHES INNER JOIN CATEGORIES ON CLOTHES.CATEGORY_ID = CATEGORIES.ID', []);
    List<Category> categories = [];
    for (Map<String, dynamic> map in result) {
      categories.add(new Category(id: map['ID'], name: map['NAME']));
    }
    return categories;
  }

  Future<bool> doesGarmentExist(
      String category, String size, String sex) async {
    var db = await _getDb();
    var result = await db.rawQuery(
        'SELECT * FROM CLOTHES, CATEGORIES WHERE CLOTHES.CATEGORY_ID = CATEGORIES.ID AND CATEGORIES.NAME = ? AND CLOTHES.SIZE = ? AND CLOTHES.SEX = ?',
        [category, size, sex]);
    return result.isNotEmpty;
  }

  Future<GarmentSQL> getGarment(
      String category, String size, String sex) async {
    var db = await _getDb();
    var result = await db.rawQuery(
        'SELECT * FROM CLOTHES, CATEGORIES WHERE CLOTHES.CATEGORY_ID = CATEGORIES.ID AND CATEGORIES.NAME = ? AND CLOTHES.SIZE = ? AND CLOTHES.SEX = ?',
        [category, size, sex]);
    var map = result[0];
    return new GarmentSQL(
        id: map["ID"],
        category: map["CATEGORY"],
        quantity: map["QUANTITY"],
        sex: map["SEX"],
        size: map["SIZE"]);
  }

  void deleteGarment(GarmentSQL garment) async {
    var db = await _getDb();
    await db.rawQuery("DELETE FROM CLOTHES WHERE ID = ?", [garment.id]);
    // await db.delete("CLOTHES", where: "ID = ?",  whereArgs: [garment.id]);
  }

  void deleteCategory(Category category) async {
    var db = await _getDb();
    await db.rawQuery("DELETE FROM CATEGORIES WHERE ID = ?", [category.id]);
  }

  Future<void> upsertGarment(GarmentSQL garment) async {
    var db = await _getDb();
    var result = await db.rawQuery(
        'SELECT CLOTHES.ID as ID, QUANTITY FROM  CLOTHES, CATEGORIES WHERE CLOTHES.CATEGORY_ID = CATEGORIES.ID AND CATEGORIES.NAME = ? AND CLOTHES.SIZE = ? AND CLOTHES.SEX = ?',
        [garment.category, garment.size, garment.sex]);

    if (result.isEmpty) {
      insertGarment(garment);
    } else {
      db.rawUpdate('UPDATE $tableName SET QUANTITY = ? WHERE ID = ?',
          [result[0]["QUANTITY"] + garment.quantity, result[0]["ID"]]);
    }
  }

  void updateGarment(GarmentSQL garment) {
    db.rawUpdate('UPDATE $tableName SET QUANTITY = ? WHERE ID = ?',
        [garment.quantity, garment.id]);
  }

  void updateCategory(Category category) {
    db.rawUpdate('UPDATE CATEGORIES SET NAME = ? WHERE ID = ?',
    [category.name, category.id]);
  }

  Future close() async {
    var db = await _getDb();
    return db.close();
  }

