class QueryHelper {
  DatabaseHelper con = new DatabaseHelper();
  Future<List<GarmentSQL>> getCardigans() async {
    var dbClient = await con.db;
    var res = await dbClient.query("category_cardigan");

    return List.generate(res.length, (index) {
      return GarmentSQL(
          id: res[index]['id'],
          category: "category_cardigan",
          quantity: res[index]['quantity'],
          sex: res[index]['sex'],
          size: res[index]['size']);
    });

    List<GarmentSQL> list = res.isNotEmpty
        ? res.map((c) => GarmentSQL().fromMap('cardigan', c)).toList()
        : null;
    return list;
  }
